import React from 'react';
import { 
    Box, 
    Container, 
    Typography, 
    Button, 
    AppBar, 
    Toolbar, 
    IconButton, 
    useTheme, 
    useMediaQuery,
    makeStyles 
} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
        backgroundColor: theme.palette.background.default, // #FBF9F7
    },
    appBar: {
        backgroundColor: 'transparent', // As per spec
        boxShadow: 'none',
        borderBottom: `1px solid ${theme.palette.divider}`, // #EAE8E4
    },
    toolbar: {
        display: 'flex',
        justifyContent: 'space-between',
    },
    navLinks: {
        display: 'flex',
        gap: theme.spacing(4),
    },
    navLink: {
        fontFamily: 'ui-serif, Georgia, Cambria, "Times New Roman", Times, serif', // Serif for nav
        fontSize: '1rem', // 16px
        fontWeight: 400,
        lineHeight: 1.4,
        color: theme.palette.text.primary, // #111111
        textDecoration: 'none',
        letterSpacing: '0em',
        '&:hover': {
            color: theme.palette.primary.main, // Accent on hover
        }
    },
    heroContainer: {
        flexGrow: 1,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        textAlign: 'center',
        paddingTop: theme.spacing(10), // ~80px
        paddingBottom: theme.spacing(10),
        paddingLeft: theme.spacing(3), // ~24px mobile
        paddingRight: theme.spacing(3),
        [theme.breakpoints.up('md')]: {
            paddingLeft: theme.spacing(20), // ~160px desktop
            paddingRight: theme.spacing(20),
        },
    },
    headlineBreaking: {
        color: theme.palette.text.primary, // #111111
    },
    headlineGood: {
        color: theme.palette.primary.main, // #E27B58
    },
    tagline: {
        marginTop: theme.spacing(2), // 16px margin
        fontFamily: 'Inter, Helvetica Neue, Arial, sans-serif', // Spec sans-serif
        fontSize: '1.125rem', // 18px
        lineHeight: 1.5,
        color: theme.palette.text.secondary, // #4F4F4F
        maxWidth: '600px', // Limit width for readability
        marginLeft: 'auto',
        marginRight: 'auto',
    },
    loginButton: {
        // Uses button overrides from theme
    },
}));

const LandingPage = ({ onNavigate }) => {
    const classes = useStyles();
    const theme = useTheme();
    const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

    // Placeholder navigation items - replace with actual app sections
    const navItems = [
        { label: 'Dashboard', index: 0 },
        { label: 'Molecule Designer', index: 1 },
        { label: 'Simulations', index: 2 },
        { label: 'Literature', index: 3 },
        { label: 'Compare', index: 4 },
        { label: 'Regulatory', index: 5 },
    ];

    return (
        <div className={classes.root}>
            <AppBar position="static" className={classes.appBar} elevation={0}>
                <Container maxWidth="lg">
                    <Toolbar disableGutters className={classes.toolbar}>
                        {/* Left: Hamburger (Mobile) or Logo (Desktop) */}
                        <Box sx={{ flexGrow: { xs: 1, md: 0 } }}>
                            {isMobile ? (
                                <IconButton edge="start" color="inherit" aria-label="menu">
                                    <MenuIcon />
                                </IconButton>
                            ) : (
                                <Typography variant="h6" component="div" sx={{ fontFamily: 'Copernicus, ui-serif'}}> 
                                    {/* Replace with actual logo if available */}
                                    Anthropic / Claude
                                </Typography>
                            )}
                        </Box>

                        {/* Center: Nav Links (Desktop) */}
                        {!isMobile && (
                            <Box className={classes.navLinks} sx={{ flexGrow: 1, justifyContent: 'center' }}>
                                {navItems.map((item) => (
                                    <Button 
                                        key={item.label}
                                        className={classes.navLink}
                                        onClick={() => onNavigate(item.index)} // Use callback to switch view
                                    >
                                        {item.label}
                                    </Button>
                                ))}
                            </Box>
                        )}

                        {/* Right: Login Button */}
                        <Box sx={{ flexGrow: { xs: 1, md: 0 }, textAlign: 'right' }}>
                             {/* Using outlined as secondary style */} 
                            <Button variant="outlined" color="primary" className={classes.loginButton}>
                                Login
                            </Button>
                        </Box>
                    </Toolbar>
                </Container>
            </AppBar>

            <Container maxWidth="md" className={classes.heroContainer}>
                <Box>
                    <Typography variant="h1">
                        <span className={classes.headlineBreaking}>Breaking</span>{' '}
                        <span className={classes.headlineGood}>Good</span>
                    </Typography>
                    <Typography variant="body1" className={classes.tagline}>
                        The future of drug-discovery research, analysis, and production. Powered by Claude.
                    </Typography>
                     {/* Optional Call to Action Button */}
                     {/* 
                     <Button 
                         variant="contained" 
                         color="primary" 
                         style={{ marginTop: theme.spacing(4) }}
                         onClick={() => onNavigate(1)} // Navigate to designer on click?
                     >
                         Start Designing
                     </Button> 
                     */}
                </Box>
            </Container>
        </div>
    );
};

export default LandingPage;
